{ T... } models a struct in C, and conform to the same ABI as C structures would for a given target. They are aggregate types, and thus each member of the structure is one element and can be accessed using aggregate instructions. Structures are padded, and their size is thus determined by the order of each element, and the size/align of each element. Note that structures satisfying one of the following conditions are zero-sized: No elements Every element is zero-sized %Vec = { ptr, i64, i64 }
%Empty = { }
%Nested = { { i32, i32 }, f64, [i8; 64] }
